        let url = 'https://api.spotify.com/v1/recommendations?limit=10&market=ES&seed_artists=4NHQUGzhtTLFvgF5SZesLK&seed_genres=classical%2Ccountry&seed_tracks=0c6xIDDpzE81m2q797ordA'
        let temp = axios.get(url, {headers: {
                'Authorization': `token ${access_token}`
            }
        })
        suggestSong=temp
    }
    useEffect(() => {
        getSuggestSong();
    }, [])
    return (
        <a>temp</a>
    )
}

export default GetRequest;
